/*!50003 CREATE*/ /*!50017 DEFINER=`dbo459221984`@`%`*/ /*!50003 trigger items_change before update on demo-items for each row
begin
  if new.status = 'active' then
    update demo-modified set xchange=1 where siteId=new.siteId;
  end if;
  if old.category = 'announce' and old.status = 'active' and new.status != 'active' then
    update demo-modified set xchange=1 where siteId=new.siteId;
  end if;
end */;;
